		}
		return 'Customer OID-'+appsmith.store.customerOID+' Entity Admin Person OID '+appsmith.store.editKeyPersonOID + 'Jurisdiction '+appsmith.store.vayApplicantJurisdiction;
	},
	chkandNavigate :() =>
	{
		if (vayKeyPersonIndList.items.length >1)
		{			
			if(appsmith.store.vayApplicantRole=='Financier')
				{
						if(appsmith.store.vayApplicantJurisdiction =='IN')
						{
							navigateTo('Entity KYC Ind Financier',{})
						}
						else
						{
							navigateTo('Entity KYC Foreign Financier',{})
						}					
				}
			else
				{
					if(appsmith.store.vayApplicantJurisdiction ==='IN'){

					if(appsmith.store.vayApplicationIndConstitutionType === "Proprietorship"){
						navigateTo('Entity KYC Ind Proprietorship',{})
					}
					else if (appsmith.store.vayApplicationIndConstitutionType === "Partnership"){
						navigateTo('Entity KYC Ind Partnership',{})
					}
					else if (appsmith.store.vayApplicationIndConstitutionType === "LLP"){
						navigateTo('Entity KYC Ind LLP',{})
					}
					else if (appsmith.store.vayApplicationIndConstitutionType === "Public Limited Company" || appsmith.store.vayApplicationIndConstitutionType === "LLC" ){
						navigateTo('Entity KYC Ind Company',{})
					}

		}
		else {
			navigateTo('Entity KYC Foreign',{})
		}	
				}
	}
	else{
	 showAlert("Please add atleast 2 Entity Administrator to go to the next step. ")
	 }
	}
}
